import { Box, Heading, Image } from '@chakra-ui/react';

function App() {
  return (
    <Box bg="black" color="white" textAlign="center" py={10}>
      <Heading as="h1" size="2xl">
        Draw my face
      </Heading>
      <Image src="https://via.placeholder.com/512x512" alt="placeholder" mt={10} mx="auto" />
    </Box>
  );
}

export default App;
